// CategorySection.js

import React from "react";
import { Route, Routes } from 'react-router-dom';

const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);


root.CategoryBox(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
  
);

reportWebVitals();

function CategoryBox() { 
    return (
        <Routes> 
            <CategorySection/>
        </Routes> 
    ); 
  }

const CategorySection = () => {
  return (
    <div className="category">
      <br/>
      <h4>대학교 공부정리(B/1-1)</h4>
      <ul>
        <li><a href="/blog/카테고리1/글1.md">디지털시스템</a></li>
        <li><a href="/blog">컴퓨터네트워크</a></li>
        <li><a href="/blog">리눅스마스터</a></li>
        <li><a href="/blog">C언어</a></li>
        <li><a href="/blog">html + 포토샵</a></li>
      </ul>
    </div>
  );
};

export default CategorySection;
